import React, {useState} from 'react'
import { BrowserRouter, Link, Routes, Route } from 'react-router-dom'
import './App.scss'
import Header from './components/Header'
import Home from './components/Home'

const fs = require('fs');
let demoTextPath = 'demoText.txt' 

const endPoint = process.env.REACT_APP_API_URI || 'http://localhost:3001'
var text = ''
var uniqueKey = 1

export default function App() {
  const [keywords, setKeywords] = useState([])
  const [questions, setQuestions] = useState([])

  const fetchData = async () => {
    try {
      text = window.document.getElementById('text').value
      const response = await fetch(endPoint + '/keywords', {
        method: 'POST',
        headers: { 
          'Content-Type': 'application/json'
         },
        body: JSON.stringify({ 
          theText: text
        }) 
      });
      const data = await response.json();
      // console.log(data.keywords)
      setKeywords(data.keywords)
    } catch (error) {
      console.log(error);
    }
  };

  const fetchQuestions = async () => {
    try {
      const response = await fetch(endPoint + '/questions', {
        method: 'POST',
        headers: { 
          'Content-Type': 'application/json'
         },
        body: JSON.stringify({ 
          theText: text,
          keywords: keywords
        }) 
      });
      const data = await response.json();
      setQuestions(data.questions)
    } catch (error) {
      console.log(error);
    }
  };

  const chargeDemoText = async () => {
    try {
      fs.readFile(stopWordsPath, 'utf8', (error, dataStop) => {
        if (error)
            console.error('Error en la lectura del archivo de stopWords: ', stopWordsPath, error);
        else {
            stopWords = dataStop.split('\n');
        }
    });
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="App">
      <Header />
      <BrowserRouter>
        <main className="App-main">
          <Routes>
            <Route path='/' element={
              <Home />
            }/>
            <Route path='/text' element={
              // <Text />
              <div className='textSide'>
                <p>Here you paste your text</p>
                <textarea id='text' className='textArea'></textarea>
                <div>
                  <button onClick={chargeDemoText}>use demo text</button>
                  <Link to='/keywords' onClick={fetchData} className='link'>
                      Search Keywords
                  </Link>
                </div>
              </div>
            }/>
            <Route path='/keywords' element={
              // <Keywords keywords={keywords}/>
              <div className='keywords'>
                <p>Founded Keywords:</p>
                <div className='keywords-container'>
                  {
                    keywords.map(key => <button key={key} className='key-button'>{key}</button>)
                  }
                </div>
                <Link to='/questions' onClick={fetchQuestions} className='link'>
                    Make Questions
                </Link>
              </div>
            }/>
            <Route path='/questions' element={
              // <Question />
              <div>
                <p>Final Questions:</p>
                <div>
                  {
                    questions.map(q => {
                      var options = q[1].split(',')
                      return <div>
                        <p key={uniqueKey}>{q[0]}</p>
                        <button key={uniqueKey}>a. {options[0]}</button>
                        <button key={uniqueKey}>b. {options[1]}</button>
                        <button key={uniqueKey}>c. {options[2]}</button>
                        <button key={uniqueKey++}>d. {options[3]}</button>
                      </div>
                    })
                  }
                </div>
                <Link to='/' className='link'>
                    Finnish Process
                </Link>
              </div>
            }/>
          </Routes>


        </main>
      </BrowserRouter>
    </div>
  )
}
